import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faGithub, faLinkedin } from '@fortawesome/free-brands-svg-icons';
import Resume from '../../PDF/Dylan_M_Collins_Resume.pdf';


const LandingPage = () => {
    return (
        <div className='mainPage'>
            <h1 className='name'>Dylan Collins</h1>
            <h4>Full Stack Web Developer</h4>
            <nav className='nav'>
                <a style={{ paddingRight: '1rem' }} target="_blank" href='https://www.linkedin.com/in/dylan-collins-bb226ba6/'><FontAwesomeIcon color='white' icon={faLinkedin} /></a>
                <a style={{ paddingLeft: '1rem' }} target="_blank" href='https://github.com/dylan17th'><FontAwesomeIcon color='white' icon={faGithub} /></a>
            </nav>
            <div style={{border: 'black solid 2px', textAlign: 'right' ,padding: '0rem 3rem', position: 'absolute', left: '75vw', top: '90vh'}}>
                <a className='resume' target="_blank" href={Resume}>Resume (PDF)</a>
            </div>
        </ div>
    )
}

export default LandingPage;
